  await connectToMongoDB()
    const app = express()


  app.use('/api', apiRoutes)

  const httpServer = http.createServer(app)

  const server = new ApolloServer({
    typeDefs,
    resolvers,
    csrfPrevention: true,
    cache: 'bounded',
